import React from "react";
import { calculateTaskCompletion } from "../utils";

const Analytics = ({ tasks }) => {
  const { totalTasks, completedTasks, percentage } = calculateTaskCompletion(tasks);

  return (
    <div className="analytics">
      <h3>Task Analytics</h3>
      <p>Total Tasks: {totalTasks}</p>
      <p>Completed Tasks: {completedTasks}</p>
      <div className="progress-bar">
        <div 
            style={{ 
                width: `${percentage}%`, 
                backgroundColor: "green",  // Optional: Adding color to the progress bar for visibility
                height: "20px",  // Optional: Adjust height if needed
                borderRadius: "5px"
            }}
            >
        </div>
      </div>
    </div>
  );
};

export default Analytics;
